import React from 'react'
import { useGetDevicesQuery } from '../../redux/api/server.api'
import './Devices.scss'
export default function Devices() {

   const {data:Devices,isLoading} = useGetDevicesQuery('') 
   if(isLoading){
    return <h1>Идет загрузка</h1>
   } 
  return (
    <div className='devices'>
      {Devices?.rows.map((el)=>

      <table className='devices_ul'>
      <tr>
        Цена
      <td>{el.name}</td>
      </tr>
      <li>{el.price}</li>
      <li>{el.brandId}</li>
      <li>{el.typeId}</li>

      </table>
      )}
    </div>
  )
}
